import React from 'react';
import { NavLink } from 'react-router-dom';
import { Col } from 'react-bootstrap';
import {faChartBar, faIdBadge, faNewspaper, faAddressCard} from '@fortawesome/free-regular-svg-icons';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
const title = ['Bảng điều khiển', 'User', 'Tin tức', 'Đăng ký'];
const icons = [faChartBar, faIdBadge, faNewspaper, faAddressCard];
const SideBar = () =>{
    const renderSideBar = title.map((items, index) =>{
        return <NavLink onCanPlayThrough={items} key={index}>
            <li><FontAwesomeIcon icon={icons[index]}/> {items}</li>
        </NavLink>
    })
    return(
        <Col xs={6} sm={6} md={6} lg={3}>
            <ul>
                {renderSideBar}
            </ul>
        </Col>
    )
}

export default SideBar;
